import * as React from 'react';

interface Props {
    name: string
}

const myStyle = {
    marginBottom: '50px',
    // fontWidth: 'bold',
    fontWeight: 9000
}

export const NavBarListElement: React.FC<Props> = ({name}) => {
    return (
        <div>
            <text style={myStyle}>
                {name}
            </text>
        </div>
    );
}
